import React from "react";
import Latestnews from "../Commonlink/Latestnews";
import Mostpopular from "../Commonlink/Mostpopular";
import Data from "../Data/lastesnes.json";

function News() {
  console.log(Data);
  return (
    <div>
      <div className="col-md-12">
        <div className="col-md-12">
          <Latestnews title="Latest News test" Data={Data} />
        </div>
        <div className="col-md-12">
          <Mostpopulartnews title="Most Popular News test" Data={Data} />
        </div>
      </div>
    </div>
  );
}

export default News;
